import React from "react";
import Input from "../../Components/Input/Input";
import Button from "../../Components/Button/Button";

const Tests = () => {
  return (
    <div>
      <form action="">
        <h2>Calculadora</h2>

        <br />
        <Input
          type={"number"}
          placeholder={"Insira um número:"}
          name={"input1"}
          id={"number1"}
        />
        <br />
        <Input
          type={"number"}
          placeholder={"Insira um número:"}
          name={"input2"}
          id={"number2"}
        />
        <br />
        <Button text={"Calcular"} type={"submit"} />
      </form>
    </div>
  );
};

export default Tests;
